import React, { Component } from "react";
import { Card, Icon } from "antd";
import "../App.css";

class Asset extends Component {
  state = {};
  render() {
    return (
      <Card hoverable>
        <h2>ETH</h2>
        <h3>00000</h3>
      </Card>
    );
  }
}

export default Asset;
